# frozen_string_literal: true

# What this script does:
# ----------------------
# Updates system resource attributes from MesServer config files.
#
# Reason for this script:
# -----------------------
# The resource model was much less detailed when UD was set up initially.
# This script brings the attributes up to date.
#
# To run:
# -------
# Debug : DEBUG=y RACK_ENV=production ruby scripts/base_script.rb BuildUdResourceTree
# Live  : RACK_ENV=production ruby scripts/base_script.rb BuildUdResourceTree
# Dev   : ruby scripts/base_script.rb BuildUdResourceTree
#
class BuildUdResourceTree < BaseScript
  def run
    DB.transaction do
      update_resources
    end

    if debug_mode
      success_response('Dry run - nothing to do')
    else
      success_response('Attributes updated')
    end
  end

  private

  def update_resources # rubocop:disable Metrics/AbcSize
    modules.each do |mod|
      hash = DB[:system_resources].where(system_resource_code: mod[:system_resource_code]).first
      next if hash.nil?

      hash = hash.merge(mod)
      hash[:mac_address] = nil if mod[:mac_address].empty?
      hash[:login] = false if hash[:login].empty?
      hash[:logoff] = false if hash[:logoff].empty?
      hash.delete(:printer)
      hash.delete(:printer_type)
      DB[:system_resources].where(id: hash[:id]).update(hash)
    end

    printers.each do |mod|
      hash = DB[:system_resources].where(system_resource_code: mod[:system_resource_code]).first
      next if hash.nil?

      hash = hash.merge(mod)
      DB[:system_resources].where(id: hash[:id]).update(hash)
    end
  end

